import React from 'react'
import TMDB from './TMDB'

const FilmPoster = (props) => {
    let posterPath = `https://image.tmdb.org/t/p/w500${props.TMDB.poster_path}`

    return (
        <div>
           <img src={posterPath} alt="" />
        </div>
    )
}

export default FilmPoster
